    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        int T = Integer.parseInt(br.readLine());
        while (T-- > 0) {
            String s = br.readLine();
            int n = s.length();
            int[] dp = new int[1 << n];
            Arrays.fill(dp, -1);
            System.out.println(f(s, 0, n, dp));
        }
    }

    static int f(String s, int i, int n, int[] dp) {
        if (i == n) return 1;
        if (dp[1 << i] != -1) return dp[1 << i];
        int res = 0;
        for (int j = i + 1; j <= n; j++) {
            res += f(s, j, n, dp);
        }
        for (int j = i + 1; j <= n; j++) {
            int a = f(s, i, j - 1, dp);
            int b = f(s, j, n, dp);
            res += a * b;
            if (i != j - 1) {
                res += a * b;
            }
        }
        dp[1 << i] = res;
        return res;
    }
}
